if mibBuilder.loadTexts: hrPrinterDetectedErrorState.setStatus('current')
if mibBuilder.loadTexts: hrPrinterDetectedErrorState.setDescription('This object represents any error conditions detected by the printer. The error conditions are encoded as bits in an octet string, with the following definitions: Condition Bit # hrDeviceStatus lowPaper 0 warning(3) or down(5) noPaper 1 warning(3) or down(5) lowToner 2 warning(3) or down(5) noToner 3 warning(3) or down(5) doorOpen 4 warning(3) or down(5) jammed 5 warning(3) or down(5) offline 6 warning(3) or down(5) serviceRequested 7 warning(3) or down(5) inputTrayMissing 8 warning(3) or down(5) outputTrayMissing 9 warning(3) or down(5) markerSupplyMissing 10 warning(3) or down(5) outputNearFull 11 warning(3) or down(5) outputFull 12 warning(3) or down(5) inputTrayEmpty 13 warning(3) or down(5) overduePreventMaint 14 warning(3) or down(5) If multiple conditions are currently detected and the hrDeviceStatus would not otherwise be unknown(1) or testing(4), the hrDeviceStatus shall correspond to the worst state of those indicated, where down(5) is worse than warning(3) which is worse than running(2). Bits are numbered starting with the most significant bit of the first byte being bit 0, the least significant bit of the first byte being bit 7, the most significant bit of the second byte being bit 8, and so on. A one bit encodes that the condition was detected, while a zero bit encodes that the condition was not detected. This object is useful for alerting an operator to specific warning or error conditions that may occur, especially those requiring human intervention. Because error bits 8 through 14 can indicate a printer that is still functioning, the corresponding (recommended) printer hrDeviceStatus can be either warning(3) or down(5). New bits may be defined by standards-track MIB modules but the maximum size of instances of this variable should be 128 octets.')
